DROP TABLE `employee`;

CREATE TABLE `employee` (
  `id_emp` mediumint,
  `phone` varchar(100) default NULL,
  `address` varchar(255) default NULL,
  `city` varchar(255),
  `state` varchar(50) default NULL,
  `zip` varchar(10) default NULL,
  `name` varchar(255) default NULL,
  `startdate` varchar(255)
);

